package types

import (
	"encoding/json"

	b64 "encoding/base64"
)

// DefaultParams returns default module parameters.
func DefaultParams() Params {
	vkey64 := ""
	vkey64Bz, err := b64.StdEncoding.DecodeString(vkey64)
	if err != nil {
		panic(err)
	}
	return Params{
		Vkey: vkey64Bz,
	}
}

// Stringer method for Params.
func (p Params) String() string {
	bz, err := json.Marshal(p)
	if err != nil {
		panic(err)
	}

	return string(bz)
}

